Haji Agus Salim (18841954), seorang ulama, politikus, dan diplomat, menjadi tokoh kunci dalam sejarah Indonesia. Aktif dalam perjuangan kemerdekaan dan anggota Jong Java, ia terkenal sebagai pemimpin yang mengintegrasikan nilai-nilai Islam dengan semangat nasionalisme. Kontribusinya yang paling signifikan terjadi dalam Konferensi Meja Bundar (KMB) tahun 1949, di mana sebagai diplomat terkemuka, ia berhasil merundingkan pengakuan internasional terhadap kemerdekaan Indonesia, memperkuat legitimasi negara di dunia internasional. Setelah kemerdekaan, Agus Salim menjadi Menteri Luar Negeri, terus membangun hubungan diplomatik yang kokoh. Kemampuannya menjembatani perbedaan etnis dan agama menegaskan perannya dalam membangun persatuan, mempromosikan harmoni antarumat beragama. Meskipun wafat pada tahun 1954, warisan dan kontribusinya sebagai arsitek diplomasi dan identitas nasional tetap dihormati dan diakui hingga kini.	2023-12-04 23:44:14.086788+00	answer-clprk5iiz0003356e99t3cvkx	f	question-clpou1gb90002356dtct3hnoi	2023-12-04 23:44:14.086788+00	user-clprjw102000108k1g9xvf3ye
